    |- models/
      |- DummyData.js
    |- controllers/
      |- DummyDataController.js
```

2. Install dependencies for the client-side (React):

```
cd client
npm init
npm install react react-dom react-router-dom axios
```

3. Install dependencies for the server-side (Node.js/Express):

```
cd ..
npm init
npm install express body-parser cors mongoose
```

4. Create a `.env` file in the root directory of the project and add the following variables:

```
MONGODB_URI=<your_mongodb_connection_string>
PORT=<your_port_number>
```

5. Set up the server-side (Node.js/Express):

- In `server/index.js`, import the required modules and set up the Express server:

```javascript
const express = require('express');
const bodyParser = require('body-parser');
const cors = require('cors');
const mongoose = require('mongoose');

const app = express();

app.use(bodyParser.json());
app.use(cors());

// Connect to MongoDB
mongoose.connect(process.env.MONGODB_URI, { useNewUrlParser: true, useUnifiedTopology: true });

// Import routes
const apiRoutes = require('./routes/api');
app.use('/api', apiRoutes);

// Start the server
const port = process.env.PORT || 5000;
app.listen(port, () => console.log(`Server running on port ${port}`));
```

- In `server/routes/api.js`, define the API routes for the dummy data:

```javascript
const express = require('express');
const router = express.Router();
const DummyDataController = require('../controllers/DummyDataController');

router.get('/', DummyDataController.getAll);
router.post('/', DummyDataController.create);

module.exports = router;
```

- In `server/controllers/DummyDataController.js`, create the controller functions for handling the API routes:

```javascript
const DummyData = require('../models/DummyData');

exports.getAll = async (req, res) => {
  try {
    const dummyData = await DummyData.find();
    res.json(dummyData);
  } catch (err) {
    res.status(500).json({ message: err.message });
  }
};

exports.create = async (req, res) => {
  const newDummyData = new DummyData(req.body);

  try {
    const savedDummyData = await newDummyData.save();
    res.status(201).json(savedDummyData);
  } catch (err) {
    res.status(400).json({ message: err.message });
  }
};
```

